import React from "react";
function Footer() {
    return ( <>
    <footer className="mt-2 w-100 bg-light text-center">
        <p>Copyright Ujjwal Varshney. All Rights Reserved | Terms And Condition</p>
    </footer>
    </> );
}

export default Footer;
